function compare(arr, arr2) {
  var l = arr.length;
  for(var i = 0; i < l; ++i)
     for(var a in arr[i])
       if(arr2[i][a] !== arr[i][a]) return [i, a, arr[i][a], arr2[i][a]];
  return false;
}


function filterDuplicates(array) {
  let tempSet = new Set(array)
  let filtered = Array.from(tempSet)

      console.log(compare(array, filtered))

  return filtered
}


export default filterDuplicates
